import React from 'react';
import Row from './Row';

const RowList = ({transactions}) => {
    return (
      <div>
        {
	    transactions.map((i) => {
	    return (
	      <Row 
	        key={'transaction-' + i}
	        id={'transactions[i]'+ i}
	        date={'transactions[i].date'}
	        desc={'transactions[i].desc'}
   	        outflow={'transactions[i].outflow'}
                inflow={'transactions[i].inflow'}
	       />
		    );
	      })
	}
      </div>
    );
}

export default RowList;
